import React from "react";

const List = ({ people }) => {
  return (
    <div>
      {people.map((person) => {
        const { id, name, age, image } = person;
        return (
          <article key={id} className="">
            <img src={image} alt={name} />
            <div>{age}</div>
          </article>
        );
      })}
    </div>
  );
};

export default List;
